import { ReactNode } from 'react';
import { Cell, IconContainer, Section } from '@telegram-apps/telegram-ui';
import { Icon28Heart } from '@telegram-apps/telegram-ui/dist/icons/28/heart';
import { Icon24ChevronRight } from '@telegram-apps/telegram-ui/dist/icons/24/chevron_right';

// Add this CSS to your stylesheet (e.g., App.css or index.css)
/*
.fixed-height-cell {
  min-height: 64px !important;
  height: 64px !important;
  display: flex !important;
  align-items: center !important;
}

.fixed-height-cell > * {
  min-height: unset !important;
}
*/

type CellProps = {
  id: number;
  left: ReactNode;
  right: ReactNode;
  text: string;
  subtitle: string;
}

const cells: CellProps[] = [
  {
    id: 1,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Учёба',
    subtitle: 'Форум • кружки • материалы',
  },
  {
    id: 2,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Студ. актив',
    subtitle: 'Клубы • события • движ',
  },
  {
    id: 3,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Преподаватели',
    subtitle: '',
  },
  {
    id: 4,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Библиотека',
    subtitle: '',
  },
  {
    id: 5,
    left: <Icon28Heart />,
    right: <Icon24ChevronRight />,
    text: 'Свободные аудитории',
    subtitle: '',
  },
];

export const CellMainSection = () => (
  <Section>
    {cells.map((cell) => (
      <Cell
        key={cell.id}
        before={<IconContainer>{cell.left}</IconContainer>}
        after={<IconContainer>{cell.right}</IconContainer>}
        subtitle={cell.subtitle}
        className="fixed-height-cell"
      >
        {cell.text}
      </Cell>
    ))}
  </Section>
);

const faqCell: CellProps = {
  id: 6,
  left: <Icon28Heart />,
  right: <Icon24ChevronRight />,
  text: 'ЧаВо',
  subtitle: 'Абитуриентам • студентам',
};

export const CellFAQSection = () => (
  <Section>
    <Cell
      key={faqCell.id}
      before={<IconContainer>{faqCell.left}</IconContainer>}
      after={<IconContainer>{faqCell.right}</IconContainer>}
      subtitle={faqCell.subtitle}
      className="fixed-height-cell"
    >
      {faqCell.text}
    </Cell>
  </Section>
);
